import React from 'react'

function Composant2({tableau}) {
  return (
    <div>
      <h2>composant1</h2>
      <ul>
        {
        tableau.map((element,index)=>{
          <li key={index}>{element}</li>

        }


        )}
        </ul>
      
        </div>
  )
}

export default Composant2
